import React from "react";
import About from "./components/About";
import Nav from "./components/Nav";
import Contact from "./components/Contact";
import "./App.css";

function App() {
  const page = "About";

  const render = () => {
    if (page == "About") {
      return <About></About>;
    } else if (page == "Contact") {
      return <Contact></Contact>;
    }
  };

  return (
    <div>
      <Nav></Nav>
      <main>{render()}</main>
    </div>
  );
}

export default App;
